import React from "react";
import ApiService from "../../Service/ApiService";
import AddNoteEn from "./AddNoteEn";
const MessageLogFormEn = () => {
  return (
    <div>
      <section>
        <h3 style={{ color: "white" }}>Welcome..! </h3>
        <button> Logout</button>
      </section>
      <section>
        <h3 style={{ color: "white" }}>Log Format</h3>
        <AddNoteEn
          AddNote={ApiService.fetchNoteHandlerEn}
          // logger={reduxUserInfo}
        ></AddNoteEn>
      </section>
      <section>
        <button onClick={ApiService.fetchNoteHandlerEn}>Update Notes</button>
      </section>
      <section>
        <h3 style={{ color: "white" }}>Log</h3>
        {/* {content} */}
      </section>
    </div>
  );
};

export default MessageLogFormEn;
